import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import Whatsapp from './Whatsapp';


// The Message array 

var messages = [
    {
        "source": "sender",
        "message": "Hello",
        "type": "text"
    },
    {
        "source": "receiver",
        "message": `Thank your for showing interest in "Term Insurance".

        Please reply with one of the below options - 
        1 to "Get Quote"
        2 to "Get List of Plans"
        3 to "Know Why you should have a Term Insurance"`,

        "type": "text"
    },

    {
        "source": "sender",
        "message": "1",
        "type": "text"
    },

    {
        "source": "receiver",
        "message": `Great! 

        How much should be the Sum Assured?

        Please reply with one of the option - 

        1 for 0.5 Cr to 1 Cr
        2 for 1 Cr to 2 Cr
        3 for 2 Cr and above

        You can reply with "HELP" anytime more options`,
        "type": "text"
    },

    {
        "source": "receiver",
        "message": "How can we help you?",
        "type": "text"
    },
    {
        "source": "sender",
        "message": "Payslip.pdf",
        "type": "pdf"
    }
]


ReactDOM.render(<Whatsapp messages={messages} />, document.getElementById('root'));

serviceWorker.unregister();
